import React from 'react';

const Home = () => {
  return (
    <div className="min-h-screen bg-gradient-to-br from-gray-900 to-black text-white flex items-center justify-center">
      <div className="text-center">
        <h1 className="text-6xl font-bold mb-4">RAVEN</h1>
        <p className="text-xl text-gray-400 mb-8">Influencer Marketing Platform</p>
        <p className="text-gray-500">Components loading soon...</p>
      </div>
    </div>
  );
};

export default Home;
